static void bsimcmg_DisSetupFnct_Actual (
  gmd_bsimcmg_t * _gmd, 
  void * dis, 
  pINT64_t instID, 
  int regID, 
  gmdWakeUpRegionFunct_t wakeup
) {
  _bsimcmg_dis_t * _dis = (_bsimcmg_dis_t *) dis;
  char strbuf_[512];

  _dis->instID = instID;
  _dis->TPeval_ = 0;
  _dis->pvaF_pvaISRC_ = NULL;
  strcpy(strbuf_,"\0");
  if (pvaGetHierInstName (instID, strbuf_)) {
  }
  _dis->hierName_ = pvaStrdup (strbuf_);
  if (1) { /* _dis was not initialized to ZERO, sigh */
    pvaDisType __thisDis;

    __thisDis.pvaState__  = NULL;
    __thisDis.pvaAccept__ = NULL;
    __thisDis.pvaInstID__ = _dis->instID;
    pvaHashDisStates (_dis->hierName_, (void *) &__thisDis,
      sizeof (_bsimcmg_state_t));
    _dis->state_    = (_bsimcmg_state_t *) __thisDis.pvaState__;
    _dis->accepted_ = (_bsimcmg_state_t *) __thisDis.pvaAccept__;
    _bsimcmg_state_alloc (_dis->state_, _gmd);
    _bsimcmg_state_alloc (_dis->accepted_, _gmd);

  }

  /* Variable initializations */

  _dis->region_id = regID;
  _dis->wakeup = wakeup;
}

static void * _bsimcmg_DisSetupFnct (
  gmd_bsimcmg_t * _gmd
) {
  return  bsimcmg_DisSetupFnct_Actual;
}

static void bsimcmg_DisDestroyFnct_Actual (
  gmd_bsimcmg_t * _gmd, void * dis) {
  _bsimcmg_dis_t * _dis = (_bsimcmg_dis_t *) dis;

  pvaRandomUpdateSeeds (_dis->instID);
  if (!(*_dis->hierName_)) {
    /* not hashed yet, and therefore states could
     * be safely freed
     */
    _bsimcmg_state_free (_dis->hierName_, _dis->state_);
    pvaFreeDisStates (_dis->state_);
    _bsimcmg_state_free (_dis->hierName_, _dis->accepted_);
    pvaFreeDisStates (_dis->accepted_);
  } /* hashed, should not free anything inside DIS */
  else {
    if (pvaDecrDisUse (_dis->hierName_) > 0) {
      return;
    }
  }


  if (_dis->hierName_) pvaSysFree (_dis->hierName_);
  _dis->hierName_ = NULL;

}

static void * _bsimcmg_DisDestroyFnct (gmd_bsimcmg_t * _gmd) {
  _gmd = 0;  /* to avoid compile warning */
  return bsimcmg_DisDestroyFnct_Actual;
}

