static void _bsimcmg_EndTimeStepEval (
  gmd_bsimcmg_t * _gmd,
  double time,
  void * diw,
  char * dis
) {
  if (dis) {
    _bsimcmg_dis_t * _dis = (_bsimcmg_dis_t *) dis;
    double time_step;
    int isBk;

    _dis->TPaccepted_ = 1; /* Before extra iteration */
    pvaAcceptTimePoint (_dis->region_id, _dis->instID, _dis->hierName_,1,time );
    if (pvaGetNextTime (&time_step, &isBk)) {
      if (isBk)
        _dis->wakeup (_dis->region_id, 0.0, time + time_step);
      else
        _dis->wakeup (_dis->region_id, time_step, 0.0);
    }
    if (_dis->state_) {
      pvaRandomUpdateSeeds (_dis->instID);

      *_dis->accepted_ = *_dis->state_;
    }
  }

}

