static int _bsimcmg_save(void *gmd_, void *dis_, FILE *fp)
{
  gmd_bsimcmg_t *_gmd = (gmd_bsimcmg_t *)gmd_;
  _bsimcmg_dis_t *_dis = (_bsimcmg_dis_t *)dis_;
  int code;

  if (!_dis) return 0;

  code = 33;
  fwrite(&code,sizeof(int),1,fp);
  code = 22;
  fwrite(&code,sizeof(int),1,fp);
  fwrite("0010000000001100000111",sizeof(char),22,fp);
  code = 30;
  fwrite(&code,sizeof(int),1,fp);
  pvaProcessSimulatorEpva2pva (fp, 1);
  code = 31;
  fwrite(&code,sizeof(int),1,fp);
  fwrite(&_dis->region_id,sizeof(int),1,fp);
  fwrite(&_dis->instID,sizeof(pINT64_t),1,fp);
  if (_dis->state_ != NULL) {
    code = 1;
    fwrite(&code,sizeof(int),1,fp);
    fwrite(_dis->state_,sizeof(_bsimcmg_state_t),1,fp);
    /* for stateArray of _dis->state_ */
    code = 0;
    fwrite(&code,sizeof(int),1,fp);
  } else {
    code = 0;
    fwrite(&code,sizeof(int),1,fp);
  }
  if (_dis->accepted_ != NULL) {
    code = 1;
    fwrite(&code,sizeof(int),1,fp);
    fwrite(_dis->accepted_,sizeof(_bsimcmg_state_t),1,fp);
    /* for stateArray of _dis->accepted_ */
    code = 0;
    fwrite(&code,sizeof(int),1,fp);
  } else {
    code = 0;
    fwrite(&code,sizeof(int),1,fp);
  }
  code = 32;
  fwrite(&code,sizeof(int),1,fp);
  return 0;
}

static int _bsimcmg_restore(void *gmd_, void *dis_, FILE *fp)
{
  gmd_bsimcmg_t *_gmd = (gmd_bsimcmg_t *)gmd_;
  _bsimcmg_dis_t *_dis = (_bsimcmg_dis_t *)dis_;
  char rtl_flags[80];
  int code, nvar;

  fread(&code,sizeof(int),1,fp);
  if (code != 33) return 1;
  fread(&nvar,sizeof(int),1,fp);
  fread(&rtl_flags,sizeof(char),nvar,fp);
  pvaProcessSimulatorOpts (NULL, 33, rtl_flags);
  fread(&code,sizeof(int),1,fp);
  if (code != 30) return 1;
  pvaProcessSimulatorEpva2pva (fp, 2);
  fread(&code,sizeof(int),1,fp);
  if (code != 31) return 1;
  fread(&_dis->region_id,sizeof(int),1,fp);
  fread(&_dis->instID,sizeof(pINT64_t),1,fp);
  fread(&code,sizeof(int),1,fp);
  if (code == 1) {
    fread(_dis->state_,sizeof(_bsimcmg_state_t),1,fp);
    /* for stateArray of _dis->state_ */
    fread(&nvar,sizeof(int),1,fp);
  }
  fread(&code,sizeof(int),1,fp);
  if (code == 1) {
    fread(_dis->accepted_,sizeof(_bsimcmg_state_t),1,fp);
    /* for stateArray of _dis->accepted_ */
    fread(&nvar,sizeof(int),1,fp);
  }
  fread(&code,sizeof(int),1,fp);
  if (code != 32) return 1;

  return 0;
}

