static const char * _bsimcmg_ProbeName (void *_gmd, int offset) {
  int diwSize = _bsimcmg_DiwSize (_gmd);
  if (offset < diwSize) {
    if (offset < ((gmd__gen__t *)_gmd)->pVAtermCount)
      return pvaEscapeLookup(((gmd__gen__t *)_gmd)->pVAtermTbl[offset].diwName);
    else
      return pvaVarProbeName ("bsimcmg", offset);
  } else {
    return pvaVarProbeName ("bsimcmg", offset);
  }
}

static const char * _bsimcmg_ProbeUnits (void *_gmd, int offset) {
  int diwSize = _bsimcmg_DiwSize (_gmd);
  if (offset < diwSize) {
    if (offset < ((gmd__gen__t *)_gmd)->pVAtermCount)
      return (_bsimcmg_TerminalType(_gmd, offset)==0) ? "V" : "A";
    else
      return NULL;
  } else {
    return pvaVarProbeUnits ("bsimcmg", offset - diwSize);
  }
}

static int _bsimcmg_ProbeWorkIndex (void *gmd_, const char *name) {
  gmd__gen__t * _gmd = (gmd__gen__t *) gmd_;
  int i;

  for ( i = 0; i < _gmd->pVAtermCount; i++) {
    if (0 == strcmp (_gmd->pVAtermTbl[i].diwName, name)) {
      return i;
    }
  }

  i = pvaVarProbeIndex ("bsimcmg", name);
  if (i >= 0) {
    return i + _bsimcmg_DiwSize (gmd_);
  }

  return -1;
}

